import React, { useState, useEffect } from 'react';
import QrReader from 'react-qr-scanner';

const QRPDFApp = () => {
  const [scannedUrl, setScannedUrl] = useState('');
  const [result, setResult] = useState(null);
  const [error, setError] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [isScanning, setIsScanning] = useState(false);
  const [apiUrl, setApiUrl] = useState('');

  useEffect(() => {
    // Get API URL from environment variables
    const wpUrl = process.env.REACT_APP_WORDPRESS_URL;
    if (!wpUrl) {
      setError('WordPress URL not configured. Please check environment variables.');
      return;
    }
    setApiUrl(`${wpUrl}/wp-content/plugins/qr-tracker-api/process`);
  }, []);

  const handleScan = async (data) => {
    if (data?.text) {
      try {
        // Validate URL format
        new URL(data.text);
        setScannedUrl(data.text);
        setIsScanning(false);
        await processScannedUrl(data.text);
      } catch (err) {
        setError('Invalid QR code URL format');
      }
    }
  };

  const handleScanError = (err) => {
    console.error('QR Scan Error:', err);
    setError('Camera access error: ' + err.message);
    setIsScanning(false);
  };

  const processScannedUrl = async (url) => {
    if (!apiUrl) {
      setError('API URL not configured');
      return;
    }

    setIsLoading(true);
    setError('');
    setResult(null);

    try {
      // Get CSRF token from meta tag (assuming it's set in index.html)
      const csrfToken = document.querySelector('meta[name="csrf-token"]')?.content;
      
      const response = await fetch(apiUrl, {
        method: 'POST',
        headers: { 
          'Content-Type': 'application/json',
          'X-CSRF-Token': csrfToken || '',
          'X-Requested-With': 'XMLHttpRequest'
        },
        credentials: 'include', // Include cookies for CSRF
        body: JSON.stringify({ 
          url,
          scanned_at: new Date().toISOString(),
          client_id: process.env.REACT_APP_CLIENT_ID
        }),
      });

      if (!response.ok) {
        const data = await response.json();
        throw new Error(data.message || `HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      
      // Validate response data
      if (!data.name || !data.phone || !data.form_title) {
        throw new Error('Invalid response data format');
      }

      setResult(data);
    } catch (err) {
      setError('API Error: ' + err.message);
      console.error('API Error Details:', err);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="scanner-container">
      <h2>QR Scanner</h2>
      
      {error && (
        <div className="error-message" role="alert">
          <p>{error}</p>
          <button onClick={() => setError('')}>Dismiss</button>
        </div>
      )}

      <button 
        onClick={() => setIsScanning(!isScanning)}
        disabled={!!error}
        className="scanner-toggle"
      >
        {isScanning ? 'Stop Scanner' : 'Start Scanner'}
      </button>

      {isScanning && (
        <div className="scanner-wrapper">
          <QrReader
            delay={300}
            onError={handleScanError}
            onScan={handleScan}
            constraints={{
              video: {
                facingMode: "environment",
                width: { ideal: 640 },
                height: { ideal: 480 }
              }
            }}
            className="qr-reader"
          />
        </div>
      )}

      {scannedUrl && (
        <div className="scan-result">
          <p><strong>Scanned URL:</strong> {scannedUrl}</p>
        </div>
      )}
      
      {isLoading && (
        <div className="loading-indicator">
          <p>Processing...</p>
        </div>
      )}

      {result && (
        <div className="result-container">
          <h3>Registration Details:</h3>
          <div className="registration-details">
            <p><strong>Name:</strong> {result.name}</p>
            <p><strong>Phone:</strong> {result.phone}</p>
            <p><strong>Form:</strong> {result.form_title}</p>
            {result.pdf_url && (
              <a 
                href={result.pdf_url} 
                target="_blank" 
                rel="noopener noreferrer"
                className="pdf-link"
              >
                View PDF
              </a>
            )}
          </div>
        </div>
      )}
    </div>
  );
};

export default QRPDFApp;
